import React from "react";

const Home = () => {
  return (
    <div className="main--home--container">
      <div className="home--grid--box">
        <div className="menu--box"></div>
        <div className="venueBooking--box"></div>
        <div className="supportArtwork--box"></div>
        <div className="supportMicroBusiness--box"></div>
        <div className="rainbowCentre--box"></div>
        <div className="donation--box"></div>
      </div>
    </div>
  );
};

export default Home;
